import Head from "next/head"
import {getSeoData} from "./utils"

const Index = (seoData) =>{

    return(
        <React.Fragment>
            <h1>NextJS with Dynamic SEO Page</h1>
        </React.Fragment>
    )
} 

Index.getInitialProps = () =>{
    return fetch('/', {method: 'GET'})
    .then(response=>{
        return response.json()
    })
    .catch(err=>console.log(err))
}

export default Index
